import React from 'react';

const ProjectCard = ({ project, onRemove }) => {
  return (
    <div className="bg-gray-800 p-4 rounded-md flex justify-between items-center mt-2">
      <div className="flex items-center">
        <div className="bg-gray-700 rounded-full w-10 h-10 flex items-center justify-center">
          <img src="https://via.placeholder.com/150" alt="icon" className="rounded-full" />
        </div>
        <div className="ml-4">
          <h3 className="text-lg font-semibold">{project.name}</h3>
          <p className="text-gray-400">{project.description}</p>
          <p className="text-gray-400">{project.url}</p>
          <p className="text-gray-400">{project.revenueUsers}</p>
          <p className="text-gray-400">{project.status}</p>
          <p className="text-gray-400">{project.category}</p>
        </div>
      </div>
      <div className="flex items-center space-x-2">
        <button className="text-pink-500" onClick={onRemove}>
          <i className="fas fa-trash"></i>
        </button>
      </div>
    </div>
  );
};

export default ProjectCard;
